import React, { Component } from 'react';
import axios from 'axios';
import {getProperties} from './db';
class Property extends Component {

    state = {  property:[]}

     componentDidMount() {
        const property = getProperties();
           this.setState({property});
    } 
    render() { 
        return (
            <div className="container mt-5">
            <div className="row">
             <div className="col d-flex">
             {this.state.property.map(prop=>(
                    <div key={prop.id} className="card" style={{width: "18rem"}}>
                        <img src={prop.img} className="card-img-top" alt="..."/>
                        <div className="card-body">
                            <p className="card-title">Bedroom: {prop.bedroom}</p>
                            <p className="card-text">Bathroom: {prop.bathroom}</p>
                            <p className="card-text">Parking: {prop.parking}</p>
                        </div>
                </div>
                ))}
             </div>
               
          </div>
          </div>
        );
    }
}
 
export default Property;
